script: |
  super -f text -I q13090.spq | sort > q13090.out

inputs:
  - name: q13090.spq
    data: |
      SELECT DISTINCT - col1 + - ( + + col0 ) AS col1 FROM tab0 (FORMAT parquet) WHERE NOT + - 47 NOT BETWEEN - col0 AND + col0;
  - name: tab0

outputs:
  - name: q13090.out
    data: |
      -108
      -98
